export function VoterReducer(state, action) {
    const initialState = [...state];
    const updatedState = [...state];

    switch (action.type) {
        case 'isLoadingElections':
            console.log('updating state');
            updatedState.isLoadingElections = action.data;
            return updatedState;
        default:
            return initialState;
    }
}
